import React, { useRef, useState } from 'react';
// Import Swiper React components
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

// import required modules
import { Autoplay, Pagination, Navigation } from 'swiper/modules';

const Baenner = () => {
  /**해당 배너 에서는 슬라이프라는 라이브러리가 쓰였습니다. */
  /* npm i swiper 로 다운로드 후 {Swiper, SwiperSlide } 로 import 합니다.*/

  return (
    <Swiper
        spaceBetween={0}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Autoplay, Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide className='box1'>Slide 1</SwiperSlide>
        <SwiperSlide className='box2'>Slide 2</SwiperSlide>
        <SwiperSlide className='box3'>Slide 3</SwiperSlide>
        <SwiperSlide className='box4'>Slide 4</SwiperSlide>
        <SwiperSlide className='box5'>Slide 5</SwiperSlide>
        <SwiperSlide className='box6'>Slide 6</SwiperSlide>
      </Swiper>
  )
}

export default Baenner
